import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios'

function App() {
  const [getMessage, setGetMessage] = useState({})
  const [getText, setGetText] = useState({})

  // useEffect(() => {
  //   axios.get('https://cryptography-web-application.herokuapp.com/flask/crypto').then(response => {
  //     console.log("SUCCESS", response)
  //     setGetMessage(response)
  //   }).catch(error => {
  //     console.log(error)
  //   })

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/flask/crypto').then(response => {
      console.log("SUCCESS", response)
      setGetMessage(response)
    }).catch(error => {
      console.log(error)
    })

  }, [])
  return (
    <div className="App">
      <header className="App-header">
        <p>Cryptography Web App</p>
        <div>{getMessage.status === 200 ?
          <h3>{getMessage.data.decryptions[1]}</h3>
          :
          <h3>LOADING</h3>}</div>
        <form>
          <label htmlFor="">
            Enter Ciphertext to decrypt
            <input type="text" value={getText.value} />
          </label>
        </form>
      </header>

    </div>
  );
}

export default App;
